import React from 'react'

const SkillsComponent = () => {
    return (
        <div className='container'>
            <div className='row '>
                
                <div className='col-2'><img src='/images/MobileDark.jpg' alt='No Preview' style={{
                    height
                        : "60px", width: "60px"
                }} /></div>

                <div className='col-2'>
                    <h3>React js</h3>
                </div>

                <div class="progress col-8" role="progressbar" aria-label="Basic example" aria-valuenow="75" aria-valuemin="0" aria-valuemax="100">
                    <div class="progress-bar w-75"></div>
                </div>
            </div>
        </div>
    )
}

export default SkillsComponent
